measurements.description:
One flower and two buds on an 8.5-cm inflorescence, juvenile inflorescence 3 buds;
	dorsal sepal chartreuse, mahogany spots coalescing into bars;
    synsepal chartreuse;	
	petals twisted, chartreuse basal one-third transitioning to light brown distal two-thirds, spotted dark brown, hirsute marginally; 
	pouch green overlaid rose-pink; staminode hirsute, green marginally, brown centrally; 
	substance firm; texture matte.
